INSERT INTO `dala_brands` VALUES (1,'2021-07-22 16:32:02','Nông lâm food','','','',1,1,1,17,''),(2,'2021-07-22 16:32:16','BerryLand','','','',1,1,1,17,''),(3,'2021-07-22 16:32:41','Ladophar','','','',1,1,1,17,''),(4,'2021-07-22 16:32:56','Biofresh','','','',1,1,1,17,''),(5,'2021-07-22 16:33:12','Dalat Natural Food','','','',1,1,1,17,''),(6,'2021-07-22 16:33:36','Quốc Lộc Coffee','','','',1,1,1,17,''),(7,'2021-07-22 16:34:01','BaolocReal coffee','','','',1,1,1,17,''),(10,'2021-10-18 11:25:03','L\'angfarm','https://appdala.net/wp-content/uploads/tai-xuong-1.png','','',1,1,1,31,''),(12,'2022-01-10 09:25:34','Ladofoods','https://appdala.net/wp-content/uploads/logo-ladofoods.jpg','Được kế thừa trên nền tảng xưởng rượu Lafaro của người Pháp, xây dựng từ những năm đầu thế kỷ 20, Công ty Cổ phần thực phẩm Lâm Đồng – Ladofoods đã giữ gìn và tiếp tục phát triển lớn mạnh. Phát huy những ưu thế đã có Ladofoods luôn nỗ lực phấn đấu để khẳng định vị thế là nhà làm vang số 1 tại Việt Nam. Ladofoods cam kết mang đến cho khách hàng những chai vang chất lượng theo chuẩn mực quốc tế về vang…','',1,1,1,17,''),(13,'2022-01-13 10:12:46','Hoàng Thiên Long Farm','https://appdala.net/wp-content/uploads/logo-HTL-copy.jpg','Là một địa chỉ tin cậy cung cấp các mặt hàng nông sản , đặc sản uy tín tại thị trường Đà Lạt với kinh nghiệm hoạt động nhiều năm. Mỗi sản phẩm đều được lựa chọn kỹ lưỡng trước khi đưa đến tay khách hàng , đảm bảo giữ gìn được sự uy tín và chất lượng cho sản phẩm đặc sản Đà Lạt.','',1,1,1,34,'');
