bp','','','Đơn giản nhưng vẫn rất tinh tế và đầy đủ. Hợp quà sức khỏe \" Tết An Khang\" mang đến một trải nghiệm nhẹ nhàng, trọn vị cho mùa Tết: Sự tinh túy của 4 loại thảo dược có trong trà Actiso F có tác dụng dưỡng tâm, an thần, bồi bổ sức khỏe kết hợp với gừng sả và linh chi giúp nâng cao hệ miễn dịch. Cao Actiso giúp thải độc và bảo vệ lá gan tốt nhất.\nBộ sản phẩm AN KHANG bao gồm:\n01 hộp Trà Actiso F.\n01 hộp LadoActiso Cao ống vị ngọt tự nhiên.\n02 hộp LadoActiso Cao ống không đường.\n01 hộp LadoHerbal Trà Linh Chi+\n01 hộp LadoHerbal Trà Gừng Sả',490000,366000,'2021-12-25 11:24:25','2022-04-04 11:24:25',0,0,3,1,1,1,'','','',NULL,NULL,NULL,800),(311,'Bộ quà tặng sức khỏe -tết thịnh vượng',0,'2021-12-25 11:31:05','311KA',17,0,'https://appdala.net/wp-content/uploads/botetthinhvuong.webp','','','Detox Purebody giúp cơ thể thải độc, sáng da kết hợp với Trà Actiso F là kết tinh từ 4 loại dược liệu tốt cho sức khỏe, giúp cơ thể khỏe khoắn, tinh thần thoải mái và hệ miễn dịch được bảo vệ với trà gừng sả và linh chi.\nBộ sản phẩm VẠN PHÚC bao gồm:\n01 hộp Trà Actiso F.\n01 hộp LadoDetox Purebody.\n01 hộp LadoHerbal Trà Linh Chi+\n01 hộp LadoHerbal Trà Gừng Sả.',1170000,831000,'2021-12-25 11:24:25','2022-04-04 11:24:25',0,0,3,1,1,1,'','','',NULL,NULL,NULL,1200),(312,'Trà Actiso Nhất Diệp Nguyên Hương - Hộp 4 Gói 150g',0,'2021-12-25 11:35:07','3126A',17,0,'https://appdala.net/wp-content/uploads/nhatdiepnguyenhuong.jpg','https://appdala.net/wp-content/uploads/nhatdiepnguyenhuong1.jpg;https://appdala.net/wp-content/uploads/nhatdiepnguyenhuong2.jpg','','Nhất Diệp Nguyên Hương tuyệt phẩm trà Actiso thể hiện một cách tinh tế giá trị Tinh Hoa Dược Liệu Đà Lạt, được chế tác công phu từ những phiến lá Actisô tươi mới có phẩm chất tuyệt hảo, việc rọc lấy phiến hoàn toàn thực hiện bằng thủ công ngay sau khi được thu hoạch. Những phiến lá được chọn lọc sẽ đi qua dây chuyền xử lý bằng công nghệ sản xuất trà độc quyền của Ladophar để cho ra đời những búp trà hoàn hảo từ hương vị cũng như lợi ích cho sức khỏe. Đặc biệt toàn bộ quá trình xử lý từ lúc thu hoạch tới khi ra thành phẩm trong vòng 24h đảm bảo dưỡng chất và thành phần dược liệu được giữ lại tối đa.\nTừ 40kg lá mới làm ra 10kg phiến lá, từ 10kg phiến lá mới làm ra được 1kg trà thành phẩm. Tách trà Nhất Diệp Nguyên Hương chứa đựng trọn vẹn hương thơm thanh mát tự nhiên cùng vị đắng ngọt dịu nhẹ của Actisô đem lại cảm giác thư giãn tuyệt vời đồng thời hỗ trợ tăng cường chức năng gan mật và cải thiện tiêu hóa một cách hoàn toàn tự nhiên.\nThành phần: 100% Lá Actisô\nCông dụng:\nGiúp mát gan, lợi mật, hỗ trợ tăn cường chức năng gan, giúp cải thiện quá trình tiêu hóa.\nĐối tượng:\n-Người bị suy gan, xơ gan, men gan tăng, viêm gan\n-Người ăn uống kém tiêu, chán ăn, vàng da, mệt mỏi do chức năng gan kém\n-Người uống rượu bia nhiều, tiếp xúc hoặc sử dụng hóa chất có hại cho gan.\nCách dùng:\n-Dùng 5-10g /lần x 2-3 lần/ngày\n-Cho khoảng 5g trà vào bình với khoảng 250ml nước sôi, chờ 2-3 phút\n-Có thể dùng nhiều lần bằng cách châm thêm nước sôi mỗi khi dùng hết (tùy hương vị đậm nhạt)\n-Dùng hằng ngày thay nước, ngon hơn khi dùng nóng\nBảo quản: Nơi khô ráo, nhiệt độ dưới 30oC, tránh ánh sáng trực tiếp\nKhông sử dụng cho người mẫn cảm với bất kỳ thành phần nào có trong sản phẩm\nThực phẩm này không phải là thuốc, không có tác dụng thay thế thuốc chữa bệnh.',980000,NULL,NULL,NULL,0,0,3,1,1,1,'','','',NULL,NULL,NULL,600),(313,'Vang - Chateau DaLat Selection 750ml',0,'2022-01-05 20:24:02','31387',33,0,'https://appdala.net/wp-content/uploads/z3075076276743_0a9fb3067f9bf41066ba69a7d60e1adb.jpg','','','Sản phẩm chính hãng của công ty Vang Đà Lạt Ladofoods .',150000,NULL,NULL,NULL,127,1,12,1,1,1,'','','',NULL,NULL,NULL,1000),(314,'draf',0,'2022-01-08 16:08:14','3144I',17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,0,0,'','','',NULL,NULL,NULL,100),(315,'draf',0,'2022-01-11 11:13:01','3153G',17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,0,0,'','','',NULL,NULL,NULL,100),(316,'draf',0,'2022-01-11 11:55:05'